import React from 'react';
import { Route, Switch } from 'react-router-dom';

// Uvoz komponenata, pretpostavljajući da su nazivi identični onima s liste
import EvidencijaLovaca from './PopisLovaca';
import RasporedAktivnostiILova from './RasporedAktivnosti';
import EvidencijaPrisutnostiNaLovniDan from './UnosPrisutnosti';
import UnosDivljaci from './PopisDivljaci';
import UnosOdstrijeleneDivljaci from './UnosOdstrijela';
import Bodovi from './PopisBodova';

// U routes.js
const Routes = () => {
    return (
        <Switch>
            <Route path="/evidencija-lovaca" component={EvidencijaLovaca} />
            <Route path="/raspored-aktivnosti-i-lova" component={RasporedAktivnostiILova} />
            <Route path="/evidencija-prisutnosti-na-lovni-dan" component={EvidencijaPrisutnostiNaLovniDan} />
            <Route path="/unos-divljaci" component={UnosDivljaci} />
            <Route path="/unos-odstrijelene-divljaci" component={UnosOdstrijeleneDivljaci} />
            <Route path="/bodovi" component={Bodovi} />
            {/* Dodajte ostale rute prema potrebi */}
            {/* <Route path="/nekadrugaputanja" component={NekaDrugaKomponenta} /> */}
        </Switch>
    );
};

export default Routes;
